import React from 'react'
import '../showcase/Showcase.css'

export default function Showcase({items}){

    const gridItems = items.map((item) => (
        <h1>{item}</h1>
    ));

    return (
        <div className="showcase-wrapper">
            {gridItems}
        </div>
    )
}
